import styles from './Recomendations.module.scss';

interface RecomendationsProps {}

const Recomendations: FC<RecomendationsProps> = () => {
  const firstButton = () => {
    console.log(123);
  }
  const secondButton = (e:React.MouseEvent<HTMLButtonElement>) =>{
    const button = e.target as HTMLElement;
    const html = button.innerHTML;
    console.log(html);
  }

  const thirdButton = (id:string) => {
    console.log(id);
  }
  return (
    <div className={`Box ${styles.Recomendations}`}>
    Recomendations
    <button onClick={firstButton} className='Box'>1</button>
    <button onClick={secondButton} className='Box'>2</button>
    <button onClick= {() => thirdButton('hello')} className='Box'>3</button>
  </div>
  )
}

export default Recomendations;
